import { Bar } from 'react-chartjs-2';

const data = {
  labels: [],
  datasets: [
    {
      label: 'Outbreak Info',
      backgroundColor: [
        'rgba(112, 120, 176, 1)',
        'rgba(255,99,132,1)',
        'rgba(213, 199, 23, 1)',
        'rgba(245, 158, 102, 1)',
        'rgba(18, 18, 21, 1)'
      ],
      borderColor: 'rgba(255,99,132,0.8)',
      borderWidth: 1,
      hoverBackgroundColor: 'rgba(255,99,132,0.4)',
      hoverBorderColor: 'rgba(255,99,132,1)',
      data: []
    }
  ]
};

const prop = o => k => o[k]

const setData = (old, update) => {
  const n = {
    ...old,
    labels: [Object.keys(update)],
    datasets: [
      {
        data: Object.values(update)
      }
    ]
  }
  return n
}

export default ({ info }) => {

  const allData = setData(data, info)
  console.log(allData);
  return (
    <div>
      <h2>Outbreak Information</h2>
      <Bar
        data={allData}
        width={100}
        height={50}
        options={{
          maintainAspectRatio: false
        }}
      />
    </div>
  )
}
